import Link from 'next/link';

const LinkStyle = {
    marginRight: 15,
    color: 'FF0000'
};

const HeaderStyle = {
    backgroundColor: '#0000FF'
};

const Header = () => (
  <div style={HeaderStyle}>
      <Link href="/">
          <a style={LinkStyle}>Home</a>
      </Link>

      <Link href="/about">
          <a style={LinkStyle}>About</a>
      </Link>
  </div>
);

export default Header;
